st weâ€™re probably just not going to get along very well.\n\f\nHobbies \u0026 Interests\nSpace, AI, tech, math, neuroscience, science in general\nClassical music: I play piano (poorly) and write music (slightly less poorly).# I used to play violin (also poorly), but havenâ€™t picked it up in a while. I almost exclusively listen to classical music (that one I think Iâ€™m pretty good at!).\nReading: mainly history and sci-fi, but occasionally science, philosophy, and other subjects.#\nCamping, hiking, backpacking.\nI picked up bouldering over the past few years, along with everyone else on the planet.\nBoard games, chess, DnD, MTG; which one Iâ€™m most engaged in tends to depend on my social scene.\nI generally unwind by reading blogs,# watching youtube, or playing video games.\nLifestyle\nIâ€™m fairly neat.\nIâ€™m generally a homebody.\nI tend to be open with people I know well, but very private otherwise: I generally dislike posting things online,# and use social media exclusively for individual or group chats.\nI donâ€™t drink, smoke, or do drugs, although depending on the particulars it might be fine if you do.\nWhile I like hiking and bouldering, Iâ€™m not really athletic, and donâ€™t generally enjoy working out.\nI have very minimal exposure to popular culture: I only listen to classical music, and I watch very few movies or TV shows.\nIâ€™m not really a foodie: I enjoy good food when I have it, but I donâ€™t find it very motivating and donâ€™t really go out of my way to get it.\nIâ€™ve traveled a bit and enjoyed myself, and Iâ€™m planning on travelling more soon, but in general itâ€™s not a major priority for me.\nIâ€™m not a dog person: I donâ€™t mind other peopleâ€™s dogs, but I donâ€™t want to take care of one. I like cats and some other pets, though.\nMy sleep schedule is currently something like 11:30pm-7:30am. Iâ€™m not a morning person.\nI do not like beaches; mountains and forests are great.\nI much prefer cooler weather to hot weather.\nMiscellaneous \nIâ€™m 5â€™10â€.\nMy financial situation is, in all honesty, not particularly great at the moment. While I donâ€™t have too much student debt, I wasnâ€™t earning much during grad school, and Iâ€™m currently working on research independently with grant funding from some EA orgs while I look for more permanent employment. (On the plus side, I donâ€™t have any particularly expensive hobbies besides â€œliving in the Bay Areaâ€.)\nI used to be mostly fluent in Hebrew when I was a kid, but at this point itâ€™s very rusty.\nWhile my extended family is pretty small, I have three siblings who mean the world to me.\nLooking For\nIâ€™m looking for a monogamous, long-term relationship, and ultimately a life partner.\nIâ€™d like to have kids at some point. Iâ€™m open to waiting for that, but Iâ€™m also open to starting a family within the next few years if I find the right person.\n"},{"ty":"as","st":"document","si":0,"ei":0,"sm":{"ds_lhs":1,"ds_ulhfl":false,"ds_hi":"kix.scn8l8kqthmg"}},{"ty":"ae","et":"list","id":"kix.1haxc5s6nco1","epm":{"le_nb":{"nl_4":{"b_gf":"%4","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":162.0,"b_gs":"â—‹","b_a":0,"b_sn":1,"b_gt":9,"b_il":180.0},"nl_3":{"b_gf":"%3","b_ts":{"ts_un":false,"ts_un_i":false,"ts_sc":false,"ts_it_i":true,"ts_fgc2":{"hclr_color":"#000000","clr_type":0},"ts_st_i":true,"ts_bgc2":{"hclr_color":null,"clr_type":0},"ts_fs_i":true,"ts_ff_i":true,"ts_bgc2_i":true,"ts_it":false,"ts_va":"nor","ts_bd_i":true,"ts_va_i":true,"ts_fs":11.0,"ts_ff":"Arial","ts_st":false,"ts_bd":false,"ts_fgc2_i":true,"ts_sc_i":true,"ts_tw":400},"b_ifl":126.0,"b_gs":"â—","b_a":0,"b_sn":1,"b_gt":9,"b_il":144.0},"nl_2":{"b_gf"
